import { useNavigate } from 'react-router-dom';
import React from 'react';
import { Link } from 'react-router-dom';
import Button from '@mui/material/Button';
import './Home.css';
import HelpIcon from '@mui/icons-material/Help';
import Stack from '@mui/material/Stack';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';

const Transactions = () => {
    const navigate = useNavigate();

    return (
        <div className="transactions-page">
            <header classname = "header" >
            <Stack direction="row" spacing={65} sx={{justifyContent: "center", alignItems: "center",}}>
            <Button>
            <HelpIcon style ={{color: 'black'}}></HelpIcon>
            </Button>
       
            <h1> WalletWatch</h1>
        <Link to="/dashboard"><Button style ={{color: 'white', backgroundColor:'black', height:30}}>
        <p>Home</p>
        </Button></Link>
        </Stack>
        </header>

        <main>
                <h1>Transactions</h1>
                <Box sx={{ width: '100%', height: '50vh', borderColor: 'divider' }}>
  <Paper square elevation={3} sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
    <Tabs
      value={value}
      onChange={handleChange}
      textColor='black'
      TabIndicatorProps={{
        style: {
          backgroundColor: "green"
        }
      }}
    >
      <Tab value="savings" label="Savings" />
      <Tab value="spending" label="Spending" />
    </Tabs>
    <TableContainer sx={{ maxHeight: 'calc(100% - 48px)', overflow: 'auto' }}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell>Number</TableCell>
            <TableCell>Transaction Name</TableCell>
            <TableCell>Tag</TableCell>
            <TableCell>Category</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {transactions && transactions.length > 0 ? (
            transactions
              .filter(transaction => transaction.type.toLowerCase() === type.toLowerCase())
              .map(transaction => (
                <TableRow key={transaction.id}>
                  <TableCell>{new Date(transaction.date).toLocaleDateString()}</TableCell>
                  <TableCell>{transaction.number}</TableCell>
                  <TableCell>{transaction.transactionName}</TableCell>
                  <TableCell>{transaction.tag}</TableCell>
                  <TableCell>{transaction.category}</TableCell>
                </TableRow>
              ))
          ) : (
            <TableRow>
              <TableCell colSpan={5}>No transactions found</TableCell>
            </TableRow>
          )}
        </TableBody>
      </Table>
    </TableContainer>
  </Paper>
</Box>
        </main>

    <footer classname = "footer">
    <Stack direction="row" spacing={50} sx={{justifyContent: "center", alignItems: "center",}}>
    <Link to="/transactions"><Button style ={{color: 'white', backgroundColor:'black', height:30, width:200}}>
    <p>View Transactions</p>
    </Button></Link> 
    <Link to="/viewBudgets"><Button style ={{color: 'white', backgroundColor:'black', height:30, width:200}}>
    <p>View Budgets</p>
    </Button></Link>
    <Link to="/createAccount"><Button style ={{color: 'white', backgroundColor:'black', height:30, width:200}}>
    <p>Profile</p>
    </Button></Link> 
    </Stack>
    </footer>
    </div>
    );
};

export default Transactions;
